import React from "react";
import { useEffect, useState } from "react";

function AllProdPage() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetch("http://localhost:4000/getProducts")
      .then((res) => res.json())
      .then((data) => {
        // setProducts(data.one_car);
        console.log(data);
      });
  }, []);

  return <div>AllProdPage</div>;
}

export default AllProdPage;
